{'name': 'Yueh-Shun Li (ShamrockLee)', 'bio': "Greetings everyone! Shamrock here from Taiwan. I'm a graduate student studying High Energy Physics (Particle Physics) at National Central University. I'm also a six-year Linux user and two-year [Nixpkgs](https://github.com/NixOS/nixpkgs) contributor.

In our lab, I analyze the data produced by the [CERN Large Hadron Collider](https://home.cern/science/accelerators/large-hadron-collider) with a C++-based statistical framework called CERN ROOT.

My contribution to Nixpkgs mainly focuses on scientific software and solutions to make Nix available for unprivileged users in Nix-less, restricted environments such as HPC clusters. Aside from that, I get my hands on everything I encounter and contribute whenever it builds and runs."}

zh:
{'name': 'Kin Ko', 'bio': '地球人。人文為體，科技為用。

創業者。LikeCoin、DHK dao 發起人。

創作者。著有《區塊鏈社會學：金錢、媒體與民主的再想像》、《所謂「我不投資」，就是 all in 在法定貨幣》等。逢週四刊出《區塊鏈社會學週報》，文章全數收錄於 ckxpress.com。'}

en:
{'name': 'Kin Ko', 'bio': 'Earthling. Applying technology to serve humanity.

Entrepreneur. Founder of LikeCoin and DHK dao.

Writer. Published “The Sociology of Blockchain: Reimagining Money, Media, and Democracy” and “Moneyverse: How money works in the multiverse“, among others. Publishes “The Sociology of Blockchain” newsletter every Thursday, with all articles licensed in Creative Commons and available publicly at ckxpress.com'}

